('20180424154524152455592436552193', 'yes', '每周一', NULL, NULL, '1525436879', 0),
('A2018051000210715258828675346581', 'How do I send digital assets?', '如何發送數位資產？', NULL, NULL, '1525882867', 0),
('a2018051000411715258840778715803', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial; font-size: 17px; background-color: rgb(245, 245, 245);&quot;&gt;Since this platform is self-motivated, there will be no refund for each order after the transaction is completed. Please use your client to send out the money before the transaction. The service will confirm the order information and thank you.&lt;/span&gt;&lt;/p&gt;', '&lt;p&gt;&lt;span style=&quot;color: rgb(45, 45, 45); font-family: 微軟正黑體, &amp;quot;Microsoft JhengHei&amp;quot;, &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;因本平台自動化交易，所以每筆訂單完成交易後，即無法退款，請用戶匯出款項前，務必將訂單資訊確認再三，謝謝您。&lt;/span&gt;&lt;/p&gt;', NULL, NULL, '1525884077', 0),
('A2018052020191515268187554345721', '&lt;pre class=&quot;tw-data-text tw-ta tw-text-small&quot; style=&quot;height: 288px; text-align: right;&quot;&gt;To&amp;nbsp;make&amp;nbsp;the&amp;nbsp;platform&amp;nbsp;better&amp;nbsp;serve&amp;nbsp;our&amp;nbsp;customers,&amp;nbsp;we&amp;nbsp;are&amp;nbsp;now&amp;nbsp;opening&amp;nbsp;new&amp;nbsp;channels&amp;nbsp;for&amp;nbsp;virtual&amp;nbsp;currency&amp;nbsp;transactions&amp;nbsp;in&amp;nbsp;mainland&amp;nbsp;China.&amp;nbsp;For&amp;nbsp;the&amp;nbsp;settlement&amp;nbsp;of&amp;nbsp;RMB&amp;nbsp;in&amp;nbsp;mainland&amp;nbsp;China,&amp;nbsp;the&amp;nbsp;platform&amp;nbsp;will&amp;nbsp;display&amp;nbsp;the&amp;nbsp;currency&amp;nbsp;in&amp;nbsp;Taiwanese&amp;nbsp;dollars.&amp;nbsp;For&amp;nbsp;Mainland&amp;nbsp;China&amp;nbsp;customers&amp;nbsp;who&amp;nbsp;need&amp;nbsp;to&amp;nbsp;withdraw&amp;nbsp;cash,&amp;nbsp;you&amp;nbsp;can&amp;nbsp;check&amp;nbsp;the&amp;nbsp;exchange&amp;nbsp;rate&amp;nbsp;on&amp;nbsp;the&amp;nbsp;same&amp;nbsp;day&amp;nbsp;that&amp;nbsp;you&amp;nbsp;are&amp;nbsp;viewing&amp;nbsp;the&amp;nbsp;platform&amp;nbsp;announcement.&amp;nbsp;For&amp;nbsp;details,&amp;nbsp;please&amp;nbsp;contact&amp;nbsp;WeChat:&amp;nbsp;girls_696\n&amp;nbsp;&amp;nbsp;&amp;nbsp;\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Blnance&amp;nbsp;Coin&amp;nbsp;Trading&amp;nbsp;Platform&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '&lt;p&gt;&amp;nbsp; &amp;nbsp; 為使平臺更好的服務廣大客戶，現新開通中國大陸客戶虛擬貨幣交易渠道。對於中國大陸需以人民幣為結算，平台將實行以新台幣為基本貨幣顯示，對於需要提現的中國大陸客戶，您可以在提現當日查看平臺公告將會告知當日匯率進行結算。詳情可咨詢 &amp;nbsp;微信：girls_696&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align: right;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Blnance幣淘交易平臺&lt;/p&gt;', NULL, NULL, '1526818755', 0),
('a2018052814352715274893278228965', 'announcement', '公告：今日提現匯率', NULL, NULL, '1527489327', 0),
('A2018052914510815275766686365276', '&lt;p&gt;1 USD = 6.4138 CNY &amp;nbsp; &amp;nbsp; &amp;nbsp;1 TWD = 0.2138 CNY&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '&lt;p&gt;1 美元 = 6.4138 人民幣 &amp;nbsp; &amp;nbsp; &amp;nbsp; 1 新臺幣 = 0.2138 人民幣&lt;/p&gt;', NULL, NULL, '1527576668', 0),
