('b2018051000312115258834819759539', '&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 24px; color: rgb(45, 45, 45); font-family: 微軟正黑體, &amp;quot;Microsoft JhengHei&amp;quot;, &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;The system typically sends out digital assets from addresses that do not belong to users. We recommend searching by transaction ID for the best result.Most well-known digital asset websites and apps rely on the exclusivity of transaction IDs for record verification.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 24px; color: rgb(45, 45, 45); font-family: 微軟正黑體, &amp;quot;Microsoft JhengHei&amp;quot;, &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;從本站發送數位資產至外部錢包時並不會從用戶的地址發送。基本上就像您在便利超商領的錢不會是您在郵局存的「一樣的錢」。所以本站強烈建議用戶以具有唯一性的交易ID在區塊鏈帳本上搜尋以獲得最準確的結果證明。目前有許多以比特幣或以太幣為交易媒介並標榜高報酬的投資網站會要求使用發送地址作為依據，此為常見的詐騙手法。本站無法對其他外部網站負責，還請用戶在登錄這些高風險網站時務必小心謹慎。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', NULL, NULL, '1525883481', 0),
