('c2018051000210715258828675346814', '&lt;ul style=&quot;box-sizing: border-box; padding: 0px; margin-top: 12px; margin-bottom: 24px; margin-left: 20px; list-style-position: initial; list-style-image: initial; color: rgb(45, 45, 45); font-family: 微軟正黑體, &amp;quot;Microsoft JhengHei&amp;quot;, &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;Click on the tab labeled “Send”. There are two ways to send bitcoins (ethers) using an email address or a bitcoin(ether) address.&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;To an email address: If the email address belongs to a MaiCoin user, the bitcoins(ethers) will be directly transferred into their account.&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;However if the email address belongs to some one who does not have a Blnance account, they will receive an email inviting them to sign up for a MaiCoin account at which time they will receive the bitcoin you sent.&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;To a digital asset address: A bitcoin(ether)address is a set of code made up by alphanumeric characters between 27 and 34 characters long. To send bitcoins(ethers) to a bitcoin(ether) address, please enter the code.&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;span style=&quot;font-family: sans-serif;&quot;&gt;Next enter either the bitcoin(ether) amount or the TWD amount you would like to send.&lt;/span&gt;&lt;span style=&quot;font-family: sans-serif;&quot;&gt;You can also use &amp;quot;message board&amp;quot; to send a message to your recipient.&lt;/span&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;span style=&quot;font-family: sans-serif;&quot;&gt; (This function is only available for users who send bitcoins(ethers) using email addresses.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '&lt;ul style=&quot;box-sizing: border-box; padding: 0px; margin-top: 12px; margin-bottom: 24px; margin-left: 20px; list-style-position: initial; list-style-image: initial; color: rgb(45, 45, 45); font-family: 微軟正黑體, &amp;quot;Microsoft JhengHei&amp;quot;, &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;帳戶的 「發送」功能來傳送比特幣或以太幣，可使用電子郵件地址或數位資產地址兩種方式來發送。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;電子郵件地址： 如果欲傳送的電子郵件地址為本站用戶, 比特幣（以太幣）將直接匯入到該用戶之帳戶。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;如果郵件地址擁有人尚未成為 本站用戶，對方將收到註冊邀請來接收您發送的比特幣（以太幣）。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(45, 45, 45); font-family: 微軟正黑體, &amp;quot;Microsoft JhengHei&amp;quot;, &amp;quot;Open Sans&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;數位資產地址:&lt;/span&gt;比特幣（以太幣）地址是一組字母數字組合成的字串。如果您想發送數位資產到一個錢包地址，請輸入該字串。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;span style=&quot;font-family: sans-serif;&quot;&gt;輸入您要發送的數位資產數量(直接輸入比特幣、以太幣或等值新台幣)&lt;/span&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;span style=&quot;font-family: sans-serif;&quot;&gt;可以使用 &amp;quot;留言欄&amp;quot; 發送訊息給接收的人。 (僅限電子郵件的發送功能)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', NULL, NULL, '1525882867', 0),
